import React, { Component } from "react";
import { RoleMembers } from "../atoms/RoleMembers";

export default class ProfileMembers extends Component {
	constructor(){
		super()
		this.state = {
			role: `Organizers`,
			name: `Ardi Wiranata`,
			otherMembers: 4
		};
	}

	render (){
		return(
			<div className="bg-[#C4C4C4] mx-10 flex">
				<img className="profile-img bg-[#828282] h-16 w-16 m-5 rounded-full"></img>
				<div className="member-desc my-5">
					<RoleMembers role = {this.state.role} />
					<p className="font-medium">Ardi Wiranata &emsp; <span>4 Others.</span></p>
				</div>
			</div>
		)
	}
}
